def read_max_id_fast(tweet_csv_filepath, mode=Mode.PAST, lines=1):
    if mode == Mode.PAST:
        max_id = 9999999999999999999
        last_lines = subprocess.run("tail -10 %s" % tweet_csv_filepath, encoding='utf-8', capture_output=True)
        #print(last_line.stdout)
        lines = last_lines.stdout.split('\n')
        for line in reversed(lines):
            splitted_line = line.split(';')
            if len(splitted_line):
                try:
                    return int(splitted_line[0])
                except Exception as e:
                    print(str(e))
        return max_id #go into the past starting from oldest tweet in file
    return False #most recent tweets only


